import { useHistory } from "react-router-dom";

const yourComponent = () => {
  const history = useHistory();
  viewProfile = function() {
    history.push("/Pene.js");
  };
  return (
    <button color="primary" onClick={viewProfile}>
      View Profile
    </button>
  );
};
